import logo from './logo.svg';
import './App.css';
import Login from './pages/Login';
import Navbar from './components/Navbar';

function App() {
  return (
    <ApolloProvider client={client}>
      <Router>
        <>
        <Navbar/>
        <Routes>
            <Route 
              path='/' 
              element={<Login />} 
            />

        </Routes>
        </>
      </Router>
    </ApolloProvider>

  );
}

export default App;
